  false,\n\t\"url\": null,\n\t\"notes\": \"The Minnesota Walk-In Access site (WIA)
  GIS data represents areas of private land that have been made open to the public
  for the purpose of walk-in (foot travel) only hunting via the Walk-In Access program.
  These sites are open during any legal hunting season from September 1st to May 31st.
  Currently the WIA program covers a 21 county area in SW Minnesota. The program is
  in it's second year as a pilot program and is seeking permanent funding to continue
  operating.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
